A dictionary is a list of key-value pairs my_dictionary = [ 'apple' -> 10 'banana' -> 15 'peach' -> 3 'pear' -> 6
]
printn(my_dictionary['peach']) //prints '3' Again note the lack of a need for comma separation. (Potentially may add an option for using <- arrows in addition to -> arrows, esp. b/c of <-> arrows) Additionally if you wish, you can define a bi-directional dictionary using a double-ended arrow: my_bidictionary = [ 0 <-> 'zero' 1 <-> 'one' 'two' <-> 2 3 <-> 'three'
]
printn(my_bidictionary['three']) //prints '3'
printn(my_bidictionary[3]) //prints 'three' Note that to create an actual bidictionary, every arrow must by double-ended. As new elements are added, the bidictionary will maintain the bidirectional links between each element. Regular dictionaries will not maintin such links.

